import React, { Component } from 'react';
import App from './App';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


class Notifcation extends Component{

render(){
  return(
   <div>
     <h1>second</h1>

      <Router>
        <Link to="/app">Hide</Link>
        <Route path="/app" exact component={App} />
      </Router>
     
   </div>
    
    
  )
}

}
export default Notifcation;
